import React, {useState} from 'react';

const Register = ({onHandleSubmit}) => {

    const [state, setState] = useState({
        email: '',
        password: ''
    })

    return (
        <section className="sign-up-form__container">
            <form className="form form_type_signup sign-up-form" name="sign-up-form" onSubmit={onHandleSubmit} noValidate>
                <h3 className="form__title sign-up-form__title">Регистрация</h3>
                <input
                    type="email"
                    id="email"
                    className="form__item sign-up-form__item"
                    name="email-input"
                    placeholder="Email"
                    required/>
                {/* <span className="form__input-error email-input-error" id='emailInputError'/>*/}
                <input
                    type="password"
                    id="password"
                    className="form__item sign-up-form__item"
                    name="password-input"
                    placeholder="Пароль"
                    required/>
                {/*<span className="form__input-error email-input-error" id='emailInputError'/>*/}
                <button type="submit" className="form__submit-button sign-up-form__submit-btn">Зарегистрироваться</button>
                <p className="sign-up-form__note">Уже зарегистрированы? Войти</p>
            </form>
        </section>
    );
}

export default Register;
